// miniscript that sets headers for the given user..
import com.eviware.soapui.support.types.StringToStringMap;

getAllHttpSteps=testRunner.testCase.getTestStepsOfType(com.eviware.soapui.impl.wsdl.teststeps.RestTestRequestStep)

for (step in getAllHttpSteps){
    def headers = new StringToStringMap() 

    //my_access_token
    log.info(testRunner.testCase.testSuite.getPropertyValue("my-access-token"))

    //SEt header Authorization
    headers.put("Authorization",testRunner.testCase.testSuite.getPropertyValue("my-access-token").toString()) 

    //SEt header Ocp-Apim-Subscription-Key
    headers.put("Ocp-Apim-Subscription-Key",testRunner.testCase.testSuite.getPropertyValue("Ocp-Apim-Subscription-Key").toString())

    // Def rnd. guid.	
    def tc_companyGuid = UUID.randomUUID().toString()

    //SEt header companyGuid
	headers.put("companyGuid",tc_companyGuid.toString())
    //SEt header cache-control
	headers.put("cache-control","no-cache")

     // SEt the headers for the teststeps in testsuite.
     step.testRequest.setRequestHeaders(headers) 
}

import groovy.json.JsonSlurper
def zslurper = new JsonSlurper()

//get the response data from a test step
def zresponseJson = testRunner.testCase.getTestStepByName("ListSelfServiceAgreement").getPropertyValue("response")
def zparsedResponse = zslurper.parseText(zresponseJson)//.toString()

// get no of agreeements..
def NoOfAgreements	= zparsedResponse.selfServiceList.agreementCombinedKey.size()
//log.info("Antal aftaler: "+NoOfAgreements.toString())

// get a random no of that..
def selectedAgreementNo = Math.abs( new Random().nextInt() % (NoOfAgreements))

def zcountAccount = zparsedResponse.selfServiceList.agreementCombinedKey[selectedAgreementNo]

// Assign to AgreementComKey
testRunner.testCase.testSuite.setPropertyValue("AgreementComKey" , zcountAccount.toString())

